function ChartHelper(t){this.$container=$(t),this.$box=this.$container.parent(),this.source=this.$container.data("source"),this.params=this.$container.data("params"),this.default_options={titleTextStyle:{color:"black",fontSize:16},fontSize:10,fontName:"'Helvetica Neue', Helvetica, Arial, sans-serif",chartArea:{left:60,top:50,width:this.$container.width()-120,height:this.$container.height()-100}},this.drawChart(this.source,this.params)}ChartHelper.prototype.drawChart=function(){var t=this;$.ajax({url:t.source,data:t.params,beforeSend:function(){t.$container.empty().addClass("loading")},success:function(a){t.$container.removeClass("loading"),t.renderChart(a)},dataType:"json"})},ChartHelper.prototype.lineChart=function(t){var a=google.visualization.arrayToDataTable(t.table),e=new google.visualization.LineChart(this.$container[0]),o=$.extend(this.default_options,t.options,{pointSize:5});e.draw(a,o)},ChartHelper.prototype.columnChart=function(t){var a=google.visualization.arrayToDataTable(t.table),e=new google.visualization.DataView(a),o=new google.visualization.ColumnChart(this.$container[0]);e.setColumns([0,1,{calc:"stringify",sourceColumn:1,type:"string",role:"annotation"}]);var i=$.extend(this.default_options,t.options);o.draw(e,i)},ChartHelper.prototype.renderChart=function(t,a){switch(t.type){case"line":this.lineChart(t,a);break;case"column":this.columnChart(t,a);break;default:console.log("GraphType Error: Unsupported Graphtype:"+t.type)}};